import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import axios from 'axios';
import { Provider } from 'react-redux';
import { store } from './store'; // Import the store from your Redux store configuration file

const root = ReactDOM.createRoot(document.getElementById('root'));
axios.defaults.baseURL = "http://localhost:4000"
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Provider store={store}> {/* Pass the store as a prop to the Provider */}
        <App />
      </Provider>
    </BrowserRouter>
  </React.StrictMode>
);
